import {Component} from "react";
import CertifDisplay from "./CertifDisplay";

class Certification extends Component{

    render(){
        return(
            <div>
                <h2 className={"title"}>Certifications</h2>
                <CertifDisplay name={"Baccalauréat STI2D"} desc={"Mention Bien (Lycée Marcel Rudloff)"}/>
                <hr/>
            </div>
        );
    }
}

export default Certification;
